import React from 'react';
import "./Card.css"

class Card extends React.Component
{
    state = 
    {
        size : [this.props.width, this.props.height],
        videoCode : this.props.videoCode,
        image : "https://static0.gamerantimages.com/wordpress/wp-content/uploads/2024/02/helldivers-2-review.jpg",
        name : "heasdsadsadasdsadsadsaasdasdasdllo"
    }


    constructor(props)
    {
        super(props)
        console.log(this.state.size);

    }

    render()
    {
        const {videoCode, width, height} = this.props;


        return(<div className="items">
            <img className = "Thumbnail"
                style = {{
                   maxWidth : width - 20 + "px",
                   maxHeight : height + "px"
                }}
                src = {this.state.image}
            ></img>
            <i className = "ThumbnailTitle">{this.state.name}</i>
            
        </div>)
    }
}

export default Card;
